import React from 'react'

export default function Navigator() {
  return (
    <div>
       <div className='navigators'>
      <div className="left"><i class="fa-regular fa-circle-chevron-left"></i></div>
      <div className="right"><i class="fa-regular fa-circle-chevron-right"></i></div>
    </div>
  </div>)
}
